    public class Blake3_Implementation_Tests
    {

        #region Constructor

        [Fact]
        public void Blake3_Implementation_Constructor_ValidInputs_Works()
        {
            var hashAlgorithmWrapperConfigMock = new Mock<IBlake3Config>();
            {
                hashAlgorithmWrapperConfigMock.SetupGet(hawc => hawc.HashSizeInBits)
                    .Returns(64);

                hashAlgorithmWrapperConfigMock.Setup(hawc => hawc.Clone())
                    .Returns(() => hashAlgorithmWrapperConfigMock.Object);
            }


            GC.KeepAlive(
                new Blake3_Implementation(hashAlgorithmWrapperConfigMock.Object));
        }

        #region Config

        [Fact]
        public void Blake3_Implementation_Constructor_Config_IsNull_Throws()
        {
            Assert.Equal(
                "config",
                Assert.Throws<ArgumentNullException>(
                    () => new Blake3_Implementation(null))
                .ParamName);
        }

        [Fact]
        public void Blake3_Implementation_Constructor_Config_IsCloned()
        {
            var hashAlgorithmWrapperConfigMock = new Mock<IBlake3Config>();
            {
                hashAlgorithmWrapperConfigMock.Setup(hawc => hawc.Clone())
                    .Returns(
                        new Blake3Config());
            }

            GC.KeepAlive(
                new Blake3_Implementation(hashAlgorithmWrapperConfigMock.Object));


            hashAlgorithmWrapperConfigMock.Verify(fc => fc.Clone(), Times.Once);

            hashAlgorithmWrapperConfigMock.VerifyGet(hawc => hawc.HashSizeInBits, Times.Never);
        }

        #endregion

